import {useState} from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import Home from './pages/Home';
import About from './pages/About';
import Todos from './pages/Todos';

function App (){


  return (
    <BrowserRouter>
      <Switch>

        <Route path="">
          <Home />
        </Route>
        <Route path="/home">
        <Home/>
        </Route>

        <Route path="/about">
        <About />
        </Route>

        <Route path="/todos">
        <Todos />
        </Route>
      </Switch>
    </BrowserRouter>
  )
}
export default App;
